import { Injectable } from "@angular/core";
import { Observable } from "rxjs";
import { of } from "rxjs";

@Injectable()
export class formService{
   constructor(){}
   datos: Dato[] = [];

   public sendFormulario(nombre:string, apellido1:string):Observable<Dato[]> {
    if(nombre!="" && apellido1!=""){
        this.datos.push({nombre:nombre, apellido1:apellido1})
    }

    return of(this.datos);
   }

}
export interface Dato {nombre:string, apellido1:string}
